import ParkList from "./ParkList";
import App from "./App";

const Navbar = () => {
    return (
        <nav className="navbar">
            <h1>U.S. National Parks</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/Parks" onClickPark={() => {ParkList.setState({visible: true}); }}>Parks</a>
                <a href="/Activities" onClickActivities={() => {ParkList.setState({visible: false}); }}>Activities</a>
                <a href="/Webcams" onClickParkWebcams={() => {ParkList.setState({visible: false}); }}>Webcams</a>
            </div>
        </nav>
    );
}

export default Navbar;
